import { FC, memo } from "react";
import { useNavigate } from "react-router-dom";

export const Home: FC = memo(() => {
  const navigation = useNavigate();
  //ボタンクリック時の関数
  const onClickAdminButton = () => {
    //ログイン画面に遷移
    navigation("/login");
  };
  return (
    <div>
      <h1>TOPページ</h1>
      <button onClick={onClickAdminButton}>ログインはこちら</button>
    </div>
  );
});
